import Layout from "../components/layout";

const Blog = ({blogs}) => (
  <Layout>
    <article id="portfolio-container">
      <section>
        {console.log(blogs)}
      </section>
    </article>
  </Layout>
);

Blog.getInitialProps = ({ req }) => {
  const sample = ["blog1", "blog2", "blog3"];

  return { blogs: sample };
};

export default Blog;
